import React, { useRef } from "react";
const Index = () => {
  const f_name = useRef("");
  const f_last = useRef("");
  const f_email = useRef("");
  const f_pass = useRef("");
  const f_cpass = useRef("");
  const f_gender = useRef("");
  const f_addr = useRef("");
  return (
    <>
      <label>firstName</label>
      <input type="text" placeholder="enter some firstName" ref={f_name} />
      <br />
      <label>lastName</label>
      <input type="text" placeholder="enter some lastName" ref={f_last} />
      <br />
      <label>email:</label>
      <input type="text" placeholder="enter some email" />
      <br />
      <label>password:</label>
      <input type="text" placeholder="enter some password" />
      <br />
      <label>Confirm password:</label>
      <input type="text" placeholder="enter confirm password" />
      <br />
      <label>gender</label>
      <label>male</label>
      <input type="radio" name="fgender" />
      <label>female</label>
      <input type="radio" name="fgender" />
      <br />
      <label>Address:</label>
      <textarea rows={10} cols={20}></textarea>
      <br />
      <button>submit</button>
    </>
  );
};
export default Index;
